Tori is een verlegen Prinses die ervan droomt om een popster te zijn. Keira is een stoere popster die verlangt om een prinses te zijn.
De twee ontmoeten elkaar en worden vrienden. Tori onthult zelfs het geheim van haar koninkrijk, een orchidee die prachtige diamanten maakt.
Ze ontdekken ook dat door de hulp van een beetje gezamelijke magie, ze van plaats kunnen verwisselen en kunnen zien hoe het is om in elkaars
schoenen te staan. Ze hebben hier ernorm veel plezier in. Helaas ontdekt Keira's gemene manager Crider het geheim van de orchidee en bedenkt
een plan om deze te stelen. Tori en Keira werken samen om Cider te verslaan en de orchidee en de magie van het koninkrijk te redden.
Dit vieren ze door een enorm concert te geven voor alle inwoners. Elk meisje leert iets over zichzelf in dit magische avontuur.
De prinses leert de kracht van het zelfvertrouwen en de popster leert het plezier van de onbaatzuchtigheid.




